import styled from "styled-components";
import "../color/Theme.js";

const FooterWrapper = styled.footer`
  display: flex;
  justify-content: space-between;
  padding: 20px;
  background-color: #333;
  color: #fff;
  div {
    flex: 1;
    margin-right: 20px;
  }
`;

const FooterTxt = styled.p`
  font-size: 15px;
  color: #ececec;
  margin: 10px 0px 10px 100px;
`;


